import React, { useState } from 'react';

function Main() {
  const [data, setData] = useState({});

  React.useEffect(() => {
    fetch('https://kevinkkimutai.github.io/charity/db.json')
      .then(response => response.json())
      .then(data => setData(data));
  }, []);

  return (
    <div>
      {data.place && data.place.data.map(data => (
        <div key={data.ein}>
              {/* <h2>{data.contactName}</h2> */}

          <h2>{data.charityName
          }</h2>
          {/* <p>{data.activities}</p>
          <p>Funding: {data.funding}</p>
          <p>Goal: {data.goal}</p> */}
        </div>
      ))}
    </div>
  );
}

export default Main;
